import React from 'react'

const HeaderSocials = () => {
  return (
    <div className="home__socials">
        <a href="" className="home__social-link" target="_blank">
            <i className="fa-brands fa-instagram"></i>
        </a>
    </div>
  )
}

export default HeaderSocials
